result:
.aa {
  width: 120px;
  height: 120px;
  border-radius: 50%;
  overflow: hidden;
}

.aa img {
  position: relative;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  margin: 0 auto;
  height: 100%;
}

.index {
  margin: 20px auto;

  .resume {
    width: 820px;
    margin: 0 auto;
    padding: 20px 20px;
    box-shadow: 0px 3px 10px 5px #e9e9e9;
    border-radius: 10px;
    line-height: 28px;

    .weight {
      font-weight: 500;
    }

    .main {
      padding: 20px 12px 30px 12px;
    }

    .time {
      span {
        color: #a8a8a8;
      }
    }

    .info {
      margin-bottom: 0px;
    }

    .info {
      display: flex;
      align-items: center;

      .info_left_img {
        ::v-deep img {
          width: 100%;
        }
      }

      .info-right {
        margin-left: 50px;
      }

      &_name {
        line-height: 80px;
        display: flex;

        h1 {
          font-size: 32px;
        }

        span {
          margin-left: 15px;
          font-size: 14px;
        }
      }

      &_other {
        ::v-deep .el-descriptions__cell {
          padding-right: 35px;
        }

        i {
          color: #c0c4cc;
          font-size: 15px;
          margin-right: 10px;
        }
      }
    }

    .project {
      .project_name {
        letter-spacing: 1px;
        font-size: 16px;
      }
    }
  }
}
